import React, { useMemo } from 'react';
import { observer } from 'mobx-react';
import cx from 'classnames';
import { Pencil } from '../../../common/icons';
import AttributeValueItem from './AttributeValueItem';
import store from '../../store/RootStore';
import i18n from '../../locales';
import { parseFields } from '../../utils';
import './FrameAttributes.scss';

const FrameAttributes = observer(({ camera, cameraIndex }: { camera: string; cameraIndex: number }) => {
  const fieldsMap = useMemo(() => parseFields(store.frame.frameConfig), [store.frame.frameConfig]);

  const { currentCamera, currentFrame, isSingleCamera, attributes, frameConfig, isFrameValid } = store.frame;
  const valid = isFrameValid(camera, currentFrame);
  const { attributes: frameAttributes = {} } = attributes[camera]?.[currentFrame] || {};

  const attrKeys = Object.keys(frameAttributes);
  const fieldKeys = Object.keys(fieldsMap);
  const legacyKeys = attrKeys.filter((key) => !fieldKeys.includes(key));
  return (
    <div
      className={cx('frame-attributes', {
        selected: !isSingleCamera && currentCamera === camera,
      })}
    >
      {!isSingleCamera && (
        <div className="title">
          {`C${cameraIndex + 1}-${camera}`}
          {!store.readonly && (
            <div
              className="collapse-panel-icon"
              onClick={() => {
                if (camera !== currentCamera) {
                  store.frame.setCamera(camera);
                }
                store.config.setFrameAttributesModalVisible(true);
              }}
            >
              <Pencil />
            </div>
          )}
        </div>
      )}
      <div className="value-item">
        <div className="value-item-label">
          {i18n.translate('FRAME_ATTRIBUTES_IS_VALID_LABEL')}
        </div>
        <div className="value-item-value">
          {i18n.translate(valid ? 'FRAME_ATTRIBUTES_VALID' : 'FRAME_ATTRIBUTES_INVALID')}
        </div>
      </div>
      {frameConfig && [...fieldKeys, ...legacyKeys].map((key) => attrKeys.includes(key) && (
        <AttributeValueItem key={key} fieldName={key} fieldsMap={fieldsMap} values={frameAttributes} />
      ))}
    </div>
  );
});

export default FrameAttributes;
